import React from "react";
import { Link } from "react-router-dom";
import Auth from "../../App/Auth";
import "./Header.scss";
import { fetchData } from "../../Redux/Actions/index";
import { connect } from "react-redux";

class Header extends React.Component {
  getDataFromApi = () => {
    this.props.fetchData();
  };
  constructor(props) {
    super(props);
    this.login = this.login.bind(this);
    this.logout = this.logout.bind(this);
  }
  login() {
    // BT5LY EL IS AUTH B TRUE
    Auth.authenticate();
  }
  logout() {
    // BT5LY EL IS AUTH B FALSE
    Auth.signout();
  }
  render() {
    return (
      <div className="Header ">
        <div>
          <Link className="Header__HomeLink col" to="/">
            Home
          </Link>
          <br />
          <Link className="Header__PublicLink col " to="Public">
            Public
          </Link>
          <br />
          <Link className="Header__protectedLink col" to="protected">
            Protected
          </Link>
          <br />
        </div>
        <div className="row">
          <button className="btn btn-primary col-sm-2" onClick={this.login}>
            Login
          </button>
          <br />
          <button className="btn btn-danger col-sm-2" onClick={this.logout}>
            Logout
          </button>
          <button className="btn btn-warning col-sm-2">
            Get Data From Api {this.getDataFromApi}
          </button>
        </div>
      </div>
    );
  }
}
export default Header;
